// App.js
import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, useLocation, useNavigate } from 'react-router-dom';
import Header from './components/Header';
import CreateReservation from './pages/CreateReservation';
import MyReservations from './pages/MyReservations';
import AdminPanel from './pages/AdminPanel';
import { ReservationsProvider } from './context/ReservationsContext';
import { msalInstance } from './msalConfig';
import { EventType } from '@azure/msal-browser';
import { useDarkMode } from './hooks/useDarkMode';
import RoomCalendar from './pages/RoomCalendar';

const AppContent = () => {
  const location = useLocation();
  const navigate = useNavigate();

  const { isDark, toggle } = useDarkMode();

  const [sidebarOpen, setSidebarOpen] = useState(false);
  const [reservationToEdit, setReservationToEdit] = useState(null);

  const [msalTick, setMsalTick] = useState(0);
  useEffect(() => {
    const cbId = msalInstance.addEventCallback((event) => {
      if (
        event.eventType === EventType.LOGIN_SUCCESS ||
        event.eventType === EventType.ACQUIRE_TOKEN_SUCCESS ||
        event.eventType === EventType.HANDLE_REDIRECT_END ||
        event.eventType === EventType.LOGOUT_SUCCESS
      ) {
        setMsalTick((t) => t + 1);
      }
    });
    return () => { if (cbId) msalInstance.removeEventCallback(cbId); };
  }, []);

  const account = msalInstance.getActiveAccount() || msalInstance.getAllAccounts()[0] || null;
  const userName = account?.username || 'Invitado';

  const toggleSidebar = () => setSidebarOpen(!sidebarOpen);
  const currentPath = location.pathname;

  const handleEditReservation = (reservation) => {
    setReservationToEdit(reservation);
    navigate('/');
  };

 return (
    <div className="min-h-screen text-gray-900 dark:text-dark-text-primary bg-gradient-to-b from-[#EEF2FF] to-white dark:from-[#0D1117] dark:to-[#0B1220]">
    <Header currentPath={currentPath} />
      <Routes>

        {/* RUTA BASE: Redirigimos la raíz a la URL canónica de creación */}
        <Route path="/" element={<CreateReservationRedirect />} />

        {/* RUTA CANÓNICA DE CREACIÓN/PRE-LLENADO (Acepta /create-reservation?query...) */}
        {/* Usamos path="/create-reservation" para que el botón de navegación del Header funcione bien */}
        <Route
          path="/create-reservation"
          element={
            <CreateReservation
              userName={userName}
              sidebarOpen={sidebarOpen}
              toggleSidebar={toggleSidebar}
              reservationToEdit={null} // Es nuevo por defecto
              currentPath={currentPath}
            />
          }
        />

        {/* ✅ RUTA DE EDICIÓN: Debe ser /create-reservation/:id (o /:id) */}
        <Route
          path="/create-reservation/:id"
          element={
            <CreateReservation
              userName={userName}
              sidebarOpen={sidebarOpen}
              toggleSidebar={toggleSidebar}
              reservationToEdit={null} // Se busca internamente usando el :id
              currentPath={currentPath}
            />
          }
        />

        {/* ✅ RUTA DE CALENDARIO (Queda igual) */}
        <Route 
          path="/calendar" 
          element={
            <RoomCalendar 
               sidebarOpen={sidebarOpen} 
               toggleSidebar={() => setSidebarOpen(!sidebarSidebarOpen)}
               currentPath="/calendar"
               userName={userName}
            />
          } 
       />

        {/* RUTA MIS RESERVAS (Queda igual) */}
        <Route
          path="/my-reservations"
          element={
            <MyReservations
              userName={userName}
              sidebarOpen={sidebarOpen}
              toggleSidebar={toggleSidebar}
              currentPath={currentPath}
            />
          }
        />

        {/* RUTA ADMIN (Queda igual) */}
        <Route
          path="/admin"
          element={
            <AdminPanel
              sidebarOpen={sidebarOpen}
              toggleSidebar={toggleSidebar}
              currentPath={currentPath}
              onEdit={handleEditReservation}
            />
          }
        />
      </Routes>
    </div>
  );
};

// **Componente Auxiliar para Redirección**
// Necesario para manejar la ruta base /
const CreateReservationRedirect = () => {
    const navigate = useNavigate();
    useEffect(() => {
        navigate('/create-reservation', { replace: true });
    }, [navigate]);
    return null;
}

const App = () => (
  <Router>
    <ReservationsProvider>
      <AppContent />
    </ReservationsProvider>
  </Router>
);

export default App;
